Here's a list of everything in the pictures: 
- Glock 19, Gen 4 (with original case; paperwork);
- (5) 15-round O.E.M. factory Glock magazines;
- (5) O.E.M. factory Glock magazine replacement springs;
- (5) O.E.M. factory Glock magazine +2 base plates;
- (1) O.E.M. factory Glock Gen 4 guide rod and recoil spring.
- (1) Custom Kydex IWB holster from Multiholsters.com;
- (1) Blackhawk SERPA Level-2 Retention Holster System.

