Hello;
 I have a Pelican Bass Raider 10E + a Minn Kota 4WD trolling moter + a Stowaway Marine Deep Cycle Battery.
 The boat is made of tough ram-x material Used but in very good condition. Has some scratches from use and is dirty from being stored in my barn all winter however; it it sea worthy. There are two adjustable seats included. I added a unique item to make this a one person movable boat. I mounted a bicycle front fork and tire to the transom so you can easly move the boat by your self. The tire is removable but will not interfear with the trolling motors function. No new holes were made, I utilized the existing transom bolts to mount the hardware for the tire. The motor is a Minn Kota 4WD The Fisherman 70T with 37lbs thrust with 5 forward and 3 reverse speeds. The batter is a Stowaway Maring Deep Cycle. Asking $500.00 OBO

